import React from "react";

function add(x,y){
    let sum = x+y;
    return sum;
}
function sub(x,y){
    let sub = x-y;
    return sub;
}
function mul(x,y){
    let mul = x*y;
    return mul;
}
function div(x,y){
    let div = x/y;
    div = div.toFixed(2);
    return div;
}


export  {add, sub, mul, div};
